import { createWebHistory, createRouter } from "vue-router";

// 연결할 각 컴포넌트 import
import Content from '@/layouts/Content.vue';
import Test from '@/layouts/Test.vue';

let routes = [
    {
        path: "/",
        component: Content,
    },
    {
        path: "/test",
        component: Test,
    }
]

let router = createRouter({
    history : createWebHistory(),
    routes,
})

export default router;
